node.text:
Ho conosciuto il mondo del #babywearing quando Luna aveva 15 giorni. Era gennaio, non riuscivo ad allattare bene, non dormivo, non uscivo di casa da quando avevo partorito, mi sentivo sola e inadeguata. Una ragazza, una santa (sorella di un amico) è venuta a casa ad aiutarmi. Mi ha fatto vestire, mi ha insegnato la prima legatura, mi ha fatto uscire di casa e mi ha rimessa al mondo. Dicono che una donna nasca 2 volte, quando viene al mondo e quando diventa mamma. Io sono nata una terza volta, quando ho portato Luna per la prima volta in fascia e mi sono sentita davvero mamma. 
In foto vedete 2 fasce, quella più in basso è la prima fascia che ho acquistato e che ci ha accompagnato fino ad ora, la prima è una fascia che ho acquistato dalla mamma con cui ho fatto tutto il percorso sul portare, la bambola didattica me l'ha tessuta la mia consulente del ❤

Questi 3 gioielli saranno i miei strumenti di apprendimento e di lavoro per la formazione meravigliosa che sto seguendo 
